export default function RoomIntro(props){
    console.log(props.images)
    return(
        <div className="flex place-content-center mt-10">
                <img className="" src={props.images} alt="" />
                <div className="relative">
                    <p className="font-delafield text-9xl absolute">Miles</p>
                    {/* <p className="font-baby absolute">Room A</p> */}
                    <div className="absolute top-10">
                    <p className="font-neon">{props.title}</p>
                    <p>{props.desc}</p>
                    <p>
                        {props.intro}
                    </p>
                    </div>
                </div>
         
        </div>
    )
}
